import { useEffect, useState } from 'react'
import { getRecipesRequest } from '../api/recep.api';
import RecipeCardSearch from '../partials/RecipeCardSearch';

export type Recipe = {
  _id: string;
  title: string;
  description: string;
  author: any;
  ingredientes: Array<any>;
  comment: string;
}

function RecetteListPage() {
  const [recipes, setRecipes] = useState<Recipe[]>([])

  useEffect(() => {
    async function loardRecipes() {
      const response = await getRecipesRequest()
      setRecipes(response.data)
    }
    loardRecipes()
  },
    [])

  return (
    <div>
      {
        recipes.map(recipe => (
          <div >
            <h2>{recipe.title}</h2>
            <img src={require('../assets/mock.png')} alt="mock image" />

            <RecipeCardSearch recipes={recipe} />

          </div>
        ))
      }
    </div>
  )
}

export default RecetteListPage
